import React, { Component } from 'react';
import { connect } from 'react-redux';

class SingleSong extends Component {
  downvote(id) {
    console.log(id);
  }

  upvote(id) {
    console.log(id);
  }

  render() {
    let minutes = Math.floor(this.props.length);
    let seconds = Math.floor((this.props.length * 60) % 60);

    return (
      <tr className="singleSong">
        <th>{this.props.title}</th>
        <th>{this.props.artist}</th>
        <th>{this.props.album}</th>
        <th>
          {minutes}:{seconds}
        </th>
        <th>
          <button onClick={() => this.upvote(this.props.id)}>{`<`}</button>
          {this.props.upvotes}
          <button onClick={() => this.downvote(this.props.id)}>{`>`}</button>
        </th>
      </tr>
    );
  }
}

export default connect(
  null,
  null
)(SingleSong);
